import React from "react";
import homepageImage from './images/homepage1.png';
import './home_page1.css'; // Ensure the CSS file is correctly named and located

const HomePage = () => {
    return (
        <div className="container">
            <div className="leftDiv">
                <img
                    src={homepageImage}
                    alt="Homepage"
                    className="image"
                />
            </div>
            <div className="rightDiv">
                <div className="heading">
                    <h1>
                        <h2>Welcome to </h2>
                        <br />
                        <b>COUNT-IT</b>
                    </h1>
                </div>
                <p className="text">This is the text that will be on the right side of the homepage.</p>
            </div>
        </div>
    );
};

export default HomePage;
